import React from "react";
import "./navbar.css";
import { Link } from 'react-router-dom'


class NavBar extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {


        return (
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
              {/* <a className="navbar-brand" href="/">Classy Bank</a> */}
              <Link to="/">Classy Bank</Link>
              <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
              </button>
              <div className="collapse navbar-collapse" id="navbarNav">
                <ul className="navbar-nav">
                  <li className="nav-item"><Link to="/createAccount">Create Account</Link></li>
                  <li className="nav-item"><Link to="/login">Login</Link></li>
                  <li className="nav-item"><Link to="/deposit">Deposit</Link></li>
                  <li className="nav-item"><Link to="/withdraw">Withdraw</Link></li>
                  <li className="nav-item"><Link to="/balance">Balance</Link></li>
                  <li className="nav-item"><Link to="/alldata">All Data</Link></li>
                </ul> 
              </div>
            </nav>
          );
    }

}

export default NavBar;
